(1, 'seo.data', '{\"seo_image\":\"1\",\"keywords\":[\"bitbox\",\"viserlab\",\"crypto\",\"purchase\",\"platform\",\"crypto purchase\",\"bitcoin\"],\"description\":\"Discover the ultimate online crypto purchase platform for secure, swift, and seamless cryptocurrency transactions. Our user-friendly interface, robust security measures, and competitive rates make buying Bitcoin, Ethereum, and other cryptocurrencies easier. Join our community of savvy investors and start your crypto journey with confidence today\",\"social_title\":\"BitBox - Online Crypto Purchase Platform\",\"social_description\":\"Discover the ultimate online crypto purchase platform for secure, swift, and seamless cryptocurrency transactions. Our user-friendly interface, robust security measures, and competitive rates make buying Bitcoin, Ethereum, and other cryptocurrencies easier. Join our community of savvy investors and start your crypto journey with confidence today\",\"image\":\"66a87976c68251722317174.png\"}', NULL, NULL, '', '2020-07-04 23:42:52', '2024-07-29 23:26:15'),
(24, 'about.content', '{\"has_image\":\"1\",\"heading\":\"Latest Updates in Cryptocurrency\",\"subheading\":\"Explore the newest advancements in the cryptocurrency world and keep up with the ever-changing digital asset landscape.\",\"description\":\"Bitcoin (BTC): Known as the original cryptocurrency and often dubbed "digital gold," Bitcoin remains the market leader. Its decentralized structure and limited supply make it a reliable store of value and an efficient medium of exchange.\\r\\nEthereum (ETH): More than just a cryptocurrency, Ethereum is a decentralized platform that powers smart contracts and decentralized applications (DApps). It has become a cornerstone of innovation in decentralized finance (DeFi), non-fungible tokens (NFTs), and blockchain interoperability.\\r\\nBinance Coin (BNB): The native token of the Binance exchange, BNB is integral to the Binance ecosystem. It offers trading fee discounts, supports token sales, and drives the platform ongoing development and expansion.\",\"image\":\"66544b2c5969e1716800300.png\"}', NULL, 'basic', NULL, '2020-10-28 00:51:20', '2024-05-27 02:58:20'),
