(70, 'policy_pages.element', '{\"title\":\"Refund Policy\",\"details\":\"<div><h4>What information do we collect?<\\/h4><p>We gather data from you when you register on our site, submit a request, buy any services, react to an overview, or round out a structure. At the point when requesting any assistance or enrolling on our site, as suitable, you might be approached to enter your: name, email address, or telephone number. You may, nonetheless, visit our site anonymously.<\\/p><p><br \\/><\\/p><\\/div><div><h4>How do we protect your information?<\\/h4><p>All provided delicate\\/credit data is sent through Stripe.<br \\/>After an exchange, your private data (credit cards, social security numbers, financials, and so on) won\'t be put away on our workers.<\\/p><p><br \\/><\\/p><\\/div><div><h4>Do we disclose any information to outside parties?<\\/h4><p>We don\'t sell, exchange, or in any case move to outside gatherings by and by recognizable data. This does exclude confided in outsiders who help us in working our site, leading our business, or adjusting you, since those gatherings consent to keep this data private. We may likewise deliver your data when we accept discharge is suitable to follow the law, implement our site strategies, or ensure our own or others\' rights, property, or wellbeing.<\\/p><p><br \\/><\\/p><\\/div><div><h4>Children\'s Online Privacy Protection Act Compliance<\\/h4><p>We are consistent with the prerequisites of COPPA (Children\'s Online Privacy Protection Act), we don\'t gather any data from anybody under 13 years old. Our site, items, and administrations are completely coordinated to individuals who are in any event 13 years of age or more established.<\\/p><p><br \\/><\\/p><\\/div><div><h4>Changes to our Privacy Policy<\\/h4><p>If we decide to change our privacy policy, we will post those changes on this page.<\\/p><p><br \\/><\\/p><\\/div><div><h4>How long we retain your information?<\\/h4><p>At the point when you register for our site, we cycle and keep your information we have about you however long you don\'t erase the record or withdraw yourself (subject to laws and guidelines).<\\/p><p><br \\/><\\/p><\\/div><div><h4>What we don\\u2019t do with your data<\\/h4><p>We don\'t and will never share, unveil, sell, or in any case give your information to different organizations for the promoting of their items or administrations.<\\/p><\\/div>\"}', NULL, 'basic', 'refund-policy', '2024-03-25 06:23:35', '2024-05-25 13:20:01'),
(72, 'information.content', '{\"has_image\":\"1\",\"heading\":\"Our Additional Offerings\",\"subheading\":\"Stay ahead of the curve with the latest happenings in the cryptocurrency realm. Explore insights and updates shaping the future of digital finance.\",\"description\":\"Look before you leap! Before investing in a cryptocurrency, be sure you understand how it works, where it can be used, and how to exchange it. Read the webpages for the currency itself (such as Ethereum, Bitcoin or Litecoin) so that you fully understand how it works, and read independent articles on the cryptocurrencies you are considering as well.\\r\\n\\r\\nUse a trustworthy wallet. It is going to take some research on your part to choose the right wallet for your needs. Just like you wouldn\'t carry a million dollars around in a paper bag, don\'t choose an unknown or lesser-known wallet to protect your cryptocurrency. You want to make sure that you use a trustworthy wallet.\",\"info_image\":\"66262cfaa5a321713777914.png\"}', NULL, 'basic', NULL, '2024-04-22 09:25:14', '2024-04-22 09:29:50'),
