(81, 'kyc.content', '{\"required\":\"To ensure the security and compliance of our platform, we require all users to complete the KYC (Know Your Customer) verification process. Please log in, navigate to the KYC section, and submit the necessary documents (government-issued photo ID, proof of address, and a selfie with your ID). Your account will have limited access until verification is complete. Thank you for your cooperation.\",\"pending\":\"Your KYC verification is currently pending and under review. This process typically takes 24-48 hours. Please ensure your submitted documents are clear and match the details provided during registration. You will receive a notification once verification is complete. Thank you for your patience.\",\"reject\":\"Unfortunately, your KYC verification has been rejected due to issues with the submitted documents. Please review the rejection reason sent to your email, correct any issues, and resubmit the correct documents via the KYC section in your profile settings. Contact our support team if you need assistance.\"}', NULL, 'basic', '', '2024-05-26 05:12:13', '2024-07-30 00:53:37'),
